import React from 'react';
import ReactDOM from 'react-dom';

class Inputs extends React.Component {
	build() {
			console.log('works!');
		}

		output() {
			return false;
		}

	render() {
		// let bob = a => a + 100;

		let parameters = {
			url: '',
			source: 'test',
			medium: '',
			campaign: '',
			content: '',
			term: ''

		}

		return (
			<div className="Inputs">
				<div className="Parameterinput">
					<label>URL:</label>
					<input type="text" />
				</div>
				<div className="Parameterinput">
					<label>Source:</label>
					<input type="text" />
				</div>
				<div className="Parameterinput">
					<label>Medium:</label>
					<input type="text" />
				</div>
				<div className="Parameterinput">
					<label>Campaign:</label>
					<input type="text" />
				</div>
				<div className="Parameterinput">
					<label>Content:</label>
					<input type="text" />
				</div>
				<div className="Parameterinput">
					<label>Term:</label>
					<input type="text" />
				</div>
				<button type="button" onClick={this.build}>Build QueryString</button>
			</div>
		)
	};
};

export default Inputs;
